// assets
import { IconDashboard, IconDisc, IconPlaylist, IconSearch, IconMusicQuestion } from '@tabler/icons-react';

// constant
const icons = { IconDashboard, IconDisc, IconPlaylist, IconSearch, IconMusicQuestion };

// ==============================|| DASHBOARD MENU ITEMS ||============================== //

const dashboard = {
  id: 'dashboard',
  title: 'Dashboard',
  type: 'group',
  children: [
    {
      id: 'default',
      title: 'Dashboard',
      type: 'item',
      url: '/dashboard/default',
      icon: icons.IconDashboard,
      breadcrumbs: false
    },
    {
      id: 'albums',
      title: 'Albums',
      type: 'item',
      url: '/albums',
      icon: icons.IconDisc,
      breadcrumbs: false
    },
    {
      id: 'recommanded',
      title: 'Suprize Me',
      type: 'item',
      url: '/recommanded',
      icon: icons.IconMusicQuestion,
      breadcrumbs: false
    },
    {
      id: 'search',
      title: 'Search',
      type: 'item',
      url: '/search',
      icon: icons.IconSearch,
      breadcrumbs: false
    },

  ]
};

export default dashboard;
